double calc_kitaichi()
{
  int i,j,k;
  int tobisaki,bunsi,spring_tikai;
  double result;
  int a,b;

  tobisaki=0;
  for(i=0;i<H;i++)
    for(j=0;j<W;j++)
      if(tiles[i][j]=='.'||tiles[i][j]=='s')
	tobisaki++;
  for(k=0;k<1000;k++)
    {
      bunsi = 0;
      spring_tikai=0;
      for(i=0;i<H;i++)
	for(j=0;j<W;j++)
	  {
	    a = dist_spring[i][j] ;
	    b = dist_goal[i][j]   ;
	    // printf("%d %d %d %d %d\n",a,b,k,bunsi,spring_tikai);
	    if(a == OFF)
	      {
		if(b == OFF)
		;
		else
		  {
		    bunsi +=(b - GETA );
		  }
	      }
	    else
	      if(b == OFF)
	      {
		bunsi +=(a - GETA);
		if(a != GETA)
		  spring_tikai++;

	      }
	      else
		{
		  //printf("%c %c %d %d\n",a,b,k,a+k<b);
		  spring_tikai += (a+k < b)?1:0;
		  if(a+k < b)
		    {
		      bunsi +=(a - GETA);
		    }
		  else
		    {
		      //printf("*");
		      //spring_tikai++;
		      bunsi +=(b - GETA);		      
		    }
		}
	  }
      //printf("::%d:%d:%d\n",bunsi,tobisaki,spring_tikai);
      result = ((float)bunsi)/(tobisaki-spring_tikai);
      if(result >= (float)k && result < (float)(k+1))
      	break;
    }
  return(result);
}
